import React from 'react'

    const Orders = ({ orders }) => {
      return (
        <div>
          <center><h1>Orders List</h1></center>
          {orders.map((order) => (
            <div class="card">
              <div class="card-body">
                <h5 class="card-title">{order.name}</h5>
                <h6 class="card-subtitle mb-2 text-muted">{order.id}</h6>
                <p class="card-text">{order.customer_id}</p>
              </div>
            </div>
          ))}
        </div>
      )
    };

    export default Orders
